import React from "react";
import PropTypes from "prop-types";

const Login = () => (
  <nav className="login">
    <h2>Inventory Login</h2>
    <p>Sign in to manage your store's inventory.</p>
    <button class="github"></button>
  </nav>
);

export default Login;
